import React, {FC} from 'react';
import Toe, {Type} from "./Toe";

export interface GameProps {
    onClick?: () => void,
    width?: string,
    height?: string,
    onMouseEnterFunc?: () => void
}

const Game: FC<GameProps> = (
    {
        onClick,
        width = '300px',
        height = '300px',
        onMouseEnterFunc
    }) => {
    return (
        <div
            onClick={onClick}
            onMouseEnter={onMouseEnterFunc}
            style={{
                width,
                height,
                border: '2px solid black',
                display: 'flex',
                flexWrap:'wrap',
                alignItems:'center',
                justifyContent:'space-around'

            }}
        >
            <Toe type={Type.none}/><Toe type={Type.typeo}/><Toe type={Type.typex}/>
            <Toe/><Toe/><Toe/>
            <Toe/><Toe/><Toe/>
        </div>
    );

};

export default Game;
